            type={'font/opentype'}
            crossOrigin="anonymous"
          />
          <link
            rel={'preload'}
            href={`${IP}/Sofia Pro Ultra Light.otf`}
            as="font"
            type={'font/opentype'}
            crossOrigin="anonymous"
          />
